import React from 'react'
import {IoIosSearch} from "react-icons/io";
const Searchbar = () => {

    return (
        <header>
            <img src="https://upload.wikimedia.org/wikipedia/commons/4/48/EBay_logo.png" style={{height:'3rem', width:'3rem'}}/>
            <input style = {Inputbar} placeholder="Search"/>
                <select style = {Categorybar} name="Cat" placeholder="Ca">
                <option>Categories</option>
                </select>
                <span style={{backgroundColor:'green', textAlign:'center', justifyContent:'center', flex: 1, alignItems: 'center',paddingTop:".37rem", paddingBottom:".48rem"}}>
                <IoIosSearch size={35} style= {Searchicon}/>
                </span>
        </header>
    )
}
 
const Inputbar = {
    height: '2rem',
    flex:1, 
    width: '20rem',
    textAlign: 'center',
    borderBottomColor: 'yellow',
    borderWidth: 'thin thin .2rem thin'
}
const Categorybar = {
    height: '2.4rem',
    width: '10rem',
    flex: 1,
    borderBottomColor: 'blue',
    borderWidth: 'thin thin .2rem thin'
}
const Searchicon = {
    width:'2rem',
    height:"1rem",
}
export default Searchbar
